// Helper Functions


let setObjectValue = function (obj, type, path, value){

  console.log(obj);

  /**
	 * If the path is a string, convert it to an array
	 * @param  {String|Array} path The path
	 * @return {Array}             The path array
	 */
	let stringToPath = function (path) {
		// If the path isn't a string, return it
		if (typeof path !== 'string') return path;
		// Create new array
		let output = [];
		// Split to an array with dot notation
		path.split('.').forEach(function (item, index) {
			// Split to an array with bracket notation
			item.split(/\[([^}]+)\]/g).forEach(function (key) {
				// Push to the new array
				if (key.length > 0) {
					output.push(key);
				}
			});
		});
		return output;
	};

	// Convert the path to an array if not already
	path = stringToPath(path);

  // Store the path length and the current place in the object
  let length = path.length;
  let current = obj;

  // Loop through the path
  path.forEach(function (key, index) {
    // If last item in the loop, assign the value
    if (index === length - 1){
      if (type == 'replace'){
        current[key] = value;
      } else if (type == 'add'){
        current[key].unshift(value);
      } else if (type == 'remove'){
        current[key].splice(current[key].indexOf(value), 1);
      } else if (type == 'plus'){
        current[key] += value;
      }
    // Otherwise, update the current place in the object
    } else {
      // If the key doesn't exist, create it
      if (!current[key]){
        current[key] = {};
      }
      // Update the current place in the object
      current = current[key];
    }
  });

  console.log(obj);

}


/**
 * Return today's date
 * @param {Boolean} detailed - Include hours and minutes
 * @return {String}          - Returns the current date
 */
 let getDate = function(detailed) {
   let date = new Date();
   let day = String(date.getUTCDate());
   let month = String(date.getUTCMonth() + 1);
   let year = String(date.getUTCFullYear());
   let hours = String(date.getUTCHours()).padStart(2, '0');
   let minutes = String(date.getUTCMinutes()).padStart(2, '0');
   let seconds = String(date.getUTCSeconds()).padStart(2, '0');
   if (detailed) {
     return `${year}/${month}/${day} ${hours}:${minutes}:${seconds}`;
   } else {
     return `${year}/${month}/${day}`;
   }
 }

 let getDiffDate = function(date) {
   let diff = new Date().getTime() - new Date(date).getTime();
   let days = Math.floor(diff / (1000 * 60 * 60 * 24));
   diff = diff % (1000 * 60 * 60 * 24);
   let hours = Math.floor(diff / (1000 * 60 * 60));
   diff = diff % (1000 * 60 * 60);
   let minutes = Math.floor(diff / (1000 * 60));
   return `${days > 0 ? `${days} days ` : ''}${hours > 0 ? `${hours} hours ` : ''}${minutes} min`;
 }

/**
 * Check local storage for saved username, if found, skip login
 * @return {String}   - Stored username of returning player
 */
let checkLocalStorage = function() {
  // Retrieve user from local storage
  let username = localStorage.getItem('user');
  if (username){
    return username;
  }
}

/**
 * Clear local storage of saved username, refresh page
 */
let clearLocalStorage = function() {
  let username = localStorage.getItem('user');
  if (username){
    localStorage.removeItem('user');
  }
}

let checkUsername = async function(username) {
  let response = await fetch(`https://crib.nowicki.workers.dev?player=${username.toLowerCase()}`);
  return response.ok;
}

let checkGame = async function(id) {
  let response = await fetch(`https://crib.nowicki.workers.dev?game=${id}`);
  return response.ok;
}

/**
 * Get player profile from API
 * @param {String} username     - Username
 * @return {Object or Boolean}  - Returns profile object or status if fetch fails
 */
let getProfileData = async function(username) {
  let response = await fetch(`https://crib.nowicki.workers.dev?profile=${username.toLowerCase()}`);
  if (response.ok) {
    let profileData = await response.json();
    return profileData;
  } else {
    throw response.status;
  }
}

/**
 * Get game data from API
 * @param {String} id           - Game id
 * @return {Object or Boolean}  - Returns profile object or status if fetch fails
 */
let getTableData = async function(id) {
  let response = await fetch(`https://crib.nowicki.workers.dev?table=${id}`);
  if (response.ok) {
    let tableData = await response.json();
    return tableData;
  } else {
    throw response.status;
  }
}

let updateData = async function(changes){

  let response = await fetch('https://crib.nowicki.workers.dev', {
    method: 'PUT',
    body: JSON.stringify(changes),
    headers: {
        'Content-Type': 'application/json'
    }
  })

  if (response.ok){
    let newData = await response.json()
    return newData;
  } else {
    throw response.status;
  }

}

/**
 * Send updated player profile data to API
 * @param {Object} data - Player data object
 * @callback callback - Returns boolean
 */
let createPlayer = async function(username, callback){

  let player = playerFactory(username);

  let response = await fetch('https://crib.nowicki.workers.dev', {
    method: 'POST',
    body: JSON.stringify(player),
    headers: {
        'Content-Type': 'application/json'
    }
  })

  if (response.ok){
    let newPlayer = await response.json();
    return newPlayer;
  } else {
    throw response.status;
  }

}

/**
 * Get, update and upload player profile data
 * @param {String} player1 - Username of player 1
 * @param {String} player2 - Username of player 2
 * @callback callback - Returns game object
 */
let createGame = async function(player1, player2){
  // Generate game id
  let id = false;
  while (!id) {
    // Generate a random 9 digit game id
    id = Math.floor(100000000 + Math.random() * 900000000);
    // Check API to see if id is already in use, if so try again, otherwise break
    if (await checkGame(id)){
      id = false;
    }
  }

  let game = gameFactory(id, player1, player2, getDate());
  let response = await fetch('https://crib.nowicki.workers.dev', {
    method: 'POST',
    body: JSON.stringify(game),
    headers: {
        'Content-Type': 'application/json'
    }
  })

  if (response.ok){
    let newGame = await response.json();
    return newGame;
  } else {
    throw response.status;
  }

}



